import styled from "styled-components";
import { motion } from "framer-motion";

const SearchComponentStyle = styled(motion.div)`
  position: relative;
  width: 95%;
  left: 5%;
  height: auto;
  margin-top: 100px;
  display: flex;
  flex-direction: column;
  input {
    background-image: url("https://images.pexels.com/photos/991422/pexels-photo-991422.jpeg?auto=compress&cs=tinysrgb&h=750&w=1260");
    background-repeat: no-repeat;
    background-position: 10px 3px;
    background-size: 20px;
    padding: 10px;
    padding-left: 40px;
    background-color: transparent;
    border: none;
    border-bottom: 2px #000000 solid;
    width: 200px;
    margin-bottom: 20px;
  }
`;

const SearchComponent = () => {
  return (
    <SearchComponentStyle>
      <input placeholder="react.js" />
      <span className="sugestion"> related : </span>
    </SearchComponentStyle>
  );
};
export default SearchComponent;
